import React from "react";
import Slider from "react-slick";
import "./slick.css";
 
class Slick extends React.Component {
    render() {
      var settings = {
        dots: true
      };
      return (
        <div className="container">
          <Slider {...settings}>
            <div>
              <img src="http://placekitten.com/g/400/200" />
            </div>
          </Slider>
        </div>
      );
    }
}
export default Slick
